import React from "react";
import { NavLink } from 'react-router-dom'


function Contact() {
  return (


<section class="container">
  <h1>Nous contacter</h1>

  <footer class="py-5">
    <div class="row">
    <div class="col-2">
        <h5>Telephone</h5>
      </div>
      <div class="col-2">
        <h5>Whatsapp</h5>
      </div>
      <div class="col-2">
        <h5>Facebook</h5>
      </div>
      <div class="col-2">
        <h5>Email</h5>
      </div>
      <div class="col-2">
        <h5>Localisation</h5>
      </div>

      <div class="col-4 offset-1">
        <form>
          <h5>Se preinscrire</h5>
          <p>Preinscrivez vous des maintenant et profitez de reductions.</p>
          <div class="d-flex w-100 gap-2">
            <label for="newsletter1" class="visually-hidden">Email address</label>
            <input id="newsletter1" type="text" class="form-control" placeholder="Email address" />
            <button class="btn btn-primary" type="button">Subscribe</button>
          </div>
        </form>
      </div>
    </div>

    <div class="d-flex justify-content-between py-4 my-4 border-top">
      <p>&copy; 2021 Company, Inc. All rights reserved.</p>
      <ul class="list-unstyled d-flex">
        <li class="ms-3"><a class="link-dark" href="#"><svg class="bi" width="24" height="24"><use href="#twitter"/></svg></a></li>
        <li class="ms-3"><a class="link-dark" href="#"><svg class="bi" width="24" height="24"><use href="#instagram"/></svg></a></li>
        <li class="ms-3"><a class="link-dark" href="#"><svg class="bi" width="24" height="24"><use href="#facebook"/></svg></a></li>
      </ul>
    </div>
  </footer>
</section>


